import React, { Fragment } from "react";

interface PlaylistModalProps {
  name: string;
  action: () => void;
}

export const PlaylistModalBody = ({ name, action }: PlaylistModalProps) => {
  return (
    <Fragment>
      <div className="heading__primary-small bg-white text-center m-3">
        Confirmation
      </div>
      <div
        className="heading__secondary-small bg-white text-center"
        style={{ color: "#282828" }}
      >
        Are you sure you want to add these songs to {name}?
      </div>
      <div className="d-flex bg-white">
          <Button
            type={"primary"}
            title={"Cancel"}
            action={() => {}}
            colors={{
              backgroundColor: "rgb(255, 78, 80)",
              color: "#fff"
            }}
          />
          <Button
            type={"primary"}
            title={"Add it"}
            action={() => {}}
            colors={{
              backgroundColor: "#00D95F",
              color: "#fff"
            }}
          />
        </div>
    </Fragment>
  );
};
